import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import "../App.css"

export default class Navbar extends Component {

  render() {
    return (
      <nav style={{display: "flex", flexDirection: "row", backgroundColor: "rgb(50,50,50)", alignItems: "center", paddingLeft: 30, height: 80}}>
        <Link to="/" style={{padding: 30, fontSize: 24, color: "white", fontFamily: "sans-serif"}}>Website Name</Link>
        <Link to="/" className="navBarLink" style={{marginLeft: 20}}>Posts</Link>
        <Link to="/create" className="navBarLink">Create Post</Link>
        <Link to="/user" className="navBarLink">Sign Up</Link>
      </nav>
    );
  }
}
